import { useParams } from 'react-router-dom';
import '../../estilos/estilos.css'
import Cabecalho from '../cabecalho';

function Detalhamento(){
    const RotaParam = useParams();
    
    return(
        <div>
            <div>
                <Cabecalho />
            </div>
            <div>
                {RotaParam.Evento1}
            </div>

        </div>
    );   
}

export default Detalhamento;
